type: object
properties:
  userkey:
    type: string
    example: deadbeef
  counter:
    type: integer
    example: 1
  name:
    type: string
    example: Admin Key
  keystatus:
    type: string
    example: created
  usernum:
    type: string
    example: U01
  usernum-id:
    type: string
    example: abcdef
  last-update:
    type: integer
required:
  - userkey
  - counter
  - name
  - keystatus
  - usernum
  - usernum-id
